import Content from "./layout/Content";
import Footer from "./layout/Footer";
import Header from "./layout/Header";

const App = () => {
  return (
    <Router>
      <div className="App">
        <Header />
        <Content />
        <Footer />
      </div>
    </Router>
  );
}

export default App;
